VALUES
	(1,'Contract_of_a_staff_member','{\\rtf1\\ansi\\ansicpg1252\\cocoartf1138\\cocoasubrtf320\n{\\fonttbl\\f0\\fnil\\fcharset0 Calibri;}\n{\\colortbl;\\red255\\green255\\blue255;\\red255\\green0\\blue0;}\n{\\info\n{\\title Dear}\n{\\author Carol Syder}\n{\\*\\company Packard Bell NEC}}\\paperw11900\\paperh16840\\margl1134\\margr1134\\margb993\\margt474\\vieww11900\\viewh14220\\viewkind1\n\\deftab720\n\\pard\\pardeftab720\\ri-6\\sb120\n\n\\f0\\b\\fs28 \\cf0 Name of Employee:  \n\\b0 $staff.contact.firstNames $staff.contact.secondName\n\\b \\cf0 				\\\nName of School: \n\\b0 $camp.name\n\\b \\cf0 			Position: \n\\b0 $campStaff.job\n\\b \\cf0  \\\nCourse Dates: \n\\b0 $campStartDate, $campEndDate\n\\b \\cf0 		Pay: \\\'a3 per week\\\n\\pard\\pardeftab720\\ri-6\\sb120\\qj\n\n\\b0\\fs24 \\cf0 I undertake to work on the short-term courses run by the English Experience in the destination country in accordance with the above details.\\\nI accept that the wages stated in this contract (and travel reimbursement, where appropriate, as shown in my offer letter) will be paid at the end of the month in which the camp ends at the agreed rates. My holiday pay is included in my wage according to U.K regulations.\\\nI accept that I am employed as a temporary worker over a two-week period. My basic hours of work will be variable per week and I will be expected to be flexible and to work the hours required in accordance with the needs of the business. This may occasionally include an evening, for example, if the Final Presentation is scheduled to take place after 17:00.\\\nI have read a copy of the relevant Job Description and agree to fulfil the responsibilities outlined.  I understand that the English Experience team is responsible for the well-being and supervision of the students at all times, including but not limited to break times, whilst they are on school premises.\\\nI agree to arrive at the school at least 30 minutes prior to the start of lessons and will ensure that all students have left or are being supervised by a responsible adult before leaving the premises at the scheduled time.  I will also attend the staff meeting at the end of each camp day.   \\\nI will adhere to any rules and regulations made both by The English Experience and by the local school in terms of discipline and student conduct.   I have read and agree to the terms of the Staff Conduct and Student Behaviour Policy 2011.\\\nI agree to provide a signed Children\\\'92s Act Form and correct Tax Form before the start of the camp.\\\nIf I should cancel, I am aware that I am liable for any expenses incurred by the English Experience. If I cancel more than one month before the camp then I will be charged \\\'a350, and if I cancel less than one month before the camp I will be charged \\\'a3200, to cover administrative and travel costs. \\\nThe English Experience (UK) Ltd retains the right to cancel this contract in the event of the school cancelling the course, reducing the numbers of students or changing the dates.\\\nI understand that personal travel insurance and any cost incurred for excess baggage is my responsibility and that I will obtain an EHIC Card to carry with me at all times whilst in Europe.\\\n\\pard\\pardeftab720\\ri-6\\sb120\\sa100\n\\cf0 I accept that I will not solicit any current clients or employees of the English Experience (UK) Ltd and I will not use the English Experience (UK) Ltd logo or materials in order to set up a business in direct competition with the English Experience (UK) Ltd.\\\n\\pard\\pardeftab720\\ri-6\\sb120\n\n\\b \\cf0 \\ul \\ulc0 Signed\\\n\\pard\\pardeftab720\\ri-6\\sb120\n\\cf0 \\ulnone Employee:  \\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85....                             Date: .....\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85......\\\nPrint Name: \\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85..\\\nEmployer:                     					     Date:   \n\\b0 $campStaffContractDate\\\n\\pard\\tx720\\tx1335\\pardeftab720\\ri-6\\sb120\n\n\\b \\cf0  	            Carol Syder	\\\n		Director	\\\n}','2012-03-06 19:19:33'),
	(2,'Offer_Letter','{\\rtf1\\ansi\\ansicpg1252\\cocoartf1138\\cocoasubrtf320\n{\\fonttbl\\f0\\fnil\\fcharset0 Calibri;\\f1\\froman\\fcharset0 TimesNewRomanPSMT;\\f2\\ftech\\fcharset77 Symbol;\n}\n{\\colortbl;\\red255\\green255\\blue255;\\red255\\green0\\blue0;\\red0\\green0\\blue255;}\n{\\*\\listtable{\\list\\listtemplateid1\\listhybrid{\\listlevel\\levelnfc23\\levelnfcn23\\leveljc0\\leveljcn0\\levelfollow0\\levelstartat1\\levelspace360\\levelindent0{\\*\\levelmarker \\{disc\\}}{\\leveltext\\leveltemplateid1\\\'01\\uc0\\u8226 ;}{\\levelnumbers;}\\fi-360\\li720\\lin720 }{\\listname ;}\\listid1}\n{\\list\\listtemplateid2\\listhybrid{\\listlevel\\levelnfc23\\levelnfcn23\\leveljc0\\leveljcn0\\levelfollow0\\levelstartat1\\levelspace360\\levelindent0{\\*\\levelmarker \\{disc\\}}{\\leveltext\\leveltemplateid101\\\'01\\uc0\\u8226 ;}{\\levelnumbers;}\\fi-360\\li720\\lin720 }{\\listname ;}\\listid2}}\n{\\*\\listoverridetable{\\listoverride\\listid1\\listoverridecount0\\ls1}{\\listoverride\\listid2\\listoverridecount0\\ls2}}\n{\\info\n{\\title Dear \\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85\\\'85,}\n{\\author Camps Assistant}\n{\\*\\company Microsoft}}\\paperw11900\\paperh16840\\margl720\\margr720\\margb720\\margt720\\vieww12500\\viewh14520\\viewkind1\n\\deftab720\n\\pard\\tx7575\\pardeftab720\\ri-7\n\n\\f0\\b\\fs32 \\cf0 \\ul \\ulc0 Offer Letter- 2012\n\\f1\\b0\\fs24 \\ulnone 	\\\n\\pard\\pardeftab720\\ri-7\n\\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0 \\cf0 Dear $staff.contact.firstNames , $staff.contact.secondName \n\\f1 \\\n\\pard\\pardeftab720\\ri-7\n\\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0 \\cf0 We are pleased to offer you the following position this summer:\n\\f1 \\\n\\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b $campStaff.job at $camp.name, $camp.contact.add1, $camp.contact.add2, $camp.contact.add3 from $campStartDate to $campEndDate\n\\f1 \\\'a0\n\\f0  \\\n\\pard\\pardeftab720\\ri-7\n\n\\f1\\b0 \\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0 \\cf0 Please find attached:\\\n\\\n\\pard\\pardeftab720\\li720\\fi-360\\ri-7\n\\ls1\\ilvl0\n\\f2 \\cf0 \\\'a5	\n\\f0 Contract/s\n\\f1 \\\n\\ls1\\ilvl0\n\\f2 \\\'a5	\n\\f0 Children\\\'92s Act form\\\n\\ls1\\ilvl0\n\\f2 \\\'a5	\n\\f0 Policy on Staff Conduct and Student Behaviour\n\\f1 \\\n\\ls1\\ilvl0\n\\f2 \\\'a5	\n\\f0 P38/P46 tax form\n\\f1 \\\n\\ls1\\ilvl0\n\\f2 \\\'a5	\n\\f0 Job Description/s\n\\f1 \\\n\\ls1\\ilvl0\n\\f2 \\\'a5	\n\\f0 Travel Expense form\\\n\\pard\\pardeftab720\\ri-7\n\n\\f1 \\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b \\cf0 \\ul \\ulc0 Accepting the position: \\\n\\\n\\pard\\pardeftab720\\li720\\fi-360\\ri-7\n\\ls2\\ilvl0\n\\f2\\b0 \\cf0 \\ulnone \\\'a5	\n\\f0 \\ul Please print and read \n\\b all documents\n\\b0  \n\\f1 \\\n\\ls2\\ilvl0\n\\f2 \\ulnone \\\'a5	\n\\f0 \\ul Sign the contract and Children\'s Act form \\ulnone and send them back within 7 working days from the date of this e-mail either by email or post.\\\'a0 Please be aware that signatures must be signed by hand.\\\'a0 If you wish to return these digitally\n\\f1 ,\n\\f0  please first print the form, sign, scan it and then return by email\n\\f1 .\\\'a0\n\\f0  \n\\f1 \\\n\\ls2\\ilvl0\n\\f2 \\\'a5	\n\\f0 \\ul Tax form: P45, P46 or P38(s)\\ulnone .  All staff must return a tax form in order to be paid.  We need this as soon as possible and no later than 1 week before your camp.  For information on which tax form to complete, please see the information provided by HMRC which can be found at {\\field{\\*\\fldinst{HYPERLINK \"http://www.hmrc.gov.uk/studen\"}}{\\fldrslt \\cf3 \\ul \\ulc3 http://www.hmrc.gov.uk/students/work_hols_while_student_8_1.htm}}\n\\f1 \\\n\\pard\\pardeftab720\\ri-7\n\\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b \\cf0 \\ul \\ulc0 Travel Arrangements:\n\\f1 \\\n\n\\f0 Inside the UK\n\\f1 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b0 \\cf0 \\ulnone You will need to arrange your own transport to the airport and English Experience will arrange your outward and return flights. Please note: London Gatwick is the most commonly used airport, but flights may depart from another London airport. The details of your flights will be available to you on the online archive. We strongly recommend that if you are travelling by public transport to the airport you book tickets as soon as you have confirmation from us of your flight details, as the cost of tickets usually rises considerably if they are not booked well in advance of the travel date\n\\f1 .\\\n\\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b \\cf0 \\ul \\ulc0 Outside the UK\n\\f1 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b0 \\cf0 \\ulnone Your Staff Data form states that you will be travelling from outside of the UK and therefore you will be making your own travel arrangements. Please book your travel and send us your travel details/receipts at least 1 month before the start of the camp\n\\f1 ,\n\\f0  and complete the attached Travel Expense Form. This enables us to inform the local coordinator of your arrival time and to make host family arrangements. You will not be required to make direct contact with your host family.\\\'a0 You are reimbursed your travel expenses (up to \\\'a3195, to include airport transfers) at the same time as receiving your wage. It is important that travel is booked early\n\\f1 ,\n\\f0  so please do not hesitate to contact the office at {\\field{\\*\\fldinst{HYPERLINK \"mailto:campsadmin@paston.co.uk\"}}{\\fldrslt \\cf3 \\ul \\ulc3 campsadmin@paston.co.uk}} if you have any problems.\n\\f1 \\\n\\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b \\cf0 \\ul \\ulc0 On Line Archive\n\\f1 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b0 \\cf0 \\ulnone All camp information will be provided on our online archive\n\\f1 ,\n\\f0  which will be updated once details are finalised. This will include travel information, camp information, the camp resource file and administrative forms. Once we have received your signed contract we will send you a link and issue you with a password in order to access the archive. We will not be sending you individual information\n\\f1 ,\n\\f0  so it is your responsibility to check the archive regularly for updates. \\\n\\\n\\pard\\pardeftab720\\ri-7\n\n\\b \\cf0 \\ul \\ulc0 Host Families\\\n\\pard\\pardeftab720\\ri-7\n\n\\b0 \\cf0 \\ulnone Suitable host family accommodation is arranged by the local coordinator\n\\f1 ,\n\\f0  based on the information you have provided us. Travel to meet your host family is arranged through us. Please note, we are unable to give you your host family details in advance to avoid conflicting arrangements. We therefore do not require you to make contact with them.\n\\f1 \\\n\\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b \\cf0 \\ul \\ulc0 Health and Insurance\n\\f1 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\b0 \\cf0 \\ulnone The English Experience requires staff to have an EHIC (European Health Insurance Card) before travel and to carry it with you whilst you are in Europe. If you do not have a valid EHIC, please apply for one free of charge at {\\field{\\*\\fldinst{HYPERLINK \"http://www.ehic.org.uk\"}}{\\fldrslt \\cf3 \\ul \\ulc3 www.ehic.org.uk}} , at least two weeks before the travel date to your camp.\n\\f1 \\\n\\\n\n\\f0 The English Experience does not provide travel insurance. We strongly suggest that you take out personal travel insurance to cover the duration of your trip.\\\n\\pard\\pardeftab720\\ri-7\n\n\\f1 \\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0 \\cf0 If you have any questions please do not hesitate to contact us\n\\f1 .\\\n\\\n\n\\f0 We are delighted that you have made the decision to join us and look forward to a successful and enjoyable working relationship.\n\\f1 \\\n\\\n\\pard\\pardeftab720\\ri-7\n\n\\f0\\i\\b \\cf0 We look forward to receiving the attached forms signed within seven working days. \n\\f1\\b0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\i0 \\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f0 \\cf0 If there is a problem with you working the dates of the camps offered to you, please let us know immediately by email if you are not going to accept the contract.\n\\f1 \\\n\\\n\n\\f0 Kind regards,\\\'a0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\f1 \\cf0 \\\n\\pard\\pardeftab720\\ri-7\n\n\\fs22 \\cf0 \\\n}','2012-03-06 23:19:57'),
